import{_ as a,p as s,q as e,Z as t}from"./framework-85e9f276.js";const i="/assets/攻击截图-a66052aa.png",c="/assets/攻击截图1-07f78122.png",l={},h=t('<h1 id="_9-15-更新计划" tabindex="-1"><a class="header-anchor" href="#_9-15-更新计划" aria-hidden="true">#</a> 9.15 更新计划</h1><h2 id="_1-更新计划" tabindex="-1"><a class="header-anchor" href="#_1-更新计划" aria-hidden="true">#</a> 1 更新计划</h2><p>我计划于 2023/9/28 月开始初三内容的施工。目前我计划在国庆假期内完工</p><ul class="contains-task-list"><li class="task-list-item"><input class="task-list-item-checkbox" disabled="" type="checkbox"> 9.28 开始文档施工</li><li class="task-list-item"><input class="task-list-item-checkbox" disabled="" type="checkbox"> 10.2 完成文档内容</li><li class="task-list-item"><input class="task-list-item-checkbox" disabled="" type="checkbox"> 10.6 完成文档审查</li><li class="task-list-item"><input class="task-list-item-checkbox" disabled="" type="checkbox"> 10.7 文档正式上线</li></ul><p>此外，我们也计划与 广东省超算中心 借算力去搭建线上的 IDE 环境。减少入门门槛也方便集成内容</p><ul class="contains-task-list"><li class="task-list-item"><input class="task-list-item-checkbox" disabled="" type="checkbox"> 10.1 开始计划申请</li><li class="task-list-item"><input class="task-list-item-checkbox" disabled="" type="checkbox"> 10.3 进行环境部署</li><li class="task-list-item"><input class="task-list-item-checkbox" disabled="" type="checkbox"> 10.5 内容调试测验</li><li class="task-list-item"><input class="task-list-item-checkbox" disabled="" type="checkbox"> xx.x 内容正式上线</li></ul><p>此过程中服务器永不关闭，您可以在任何时间上线查看文档内容。具体的文档更新会另外发布公告</p><h2 id="_2-施工问答" tabindex="-1"><a class="header-anchor" href="#_2-施工问答" aria-hidden="true">#</a> 2 施工问答</h2><h3 id="_2-1-为什么做初三的内容而不是初一" tabindex="-1"><a class="header-anchor" href="#_2-1-为什么做初三的内容而不是初一" aria-hidden="true">#</a> 2.1 为什么做初三的内容而不是初一？</h3><p>首先施工者本身已经是初三的学生，可能无法继续花费大量时间更新一篇公益文档。所以我会尽可能的优先解决我需要解决的迫在眉睫的事情</p><p>初一的内容相当基础和简单，但是同样重要。但也因为它的基础，初一的内容相当多。。。超出了我一个人施工的能力范围，因此我决定交给社区施工，慢慢完善。如果施工进度过于迟缓我会考虑中考完后继续内容更新</p><p>其次是因为考虑到后续可能的 “开小灶”，所以这篇文档即便现在不写未来估计也要花费时间施工</p><h3 id="_2-2-为什么选择国庆假期施工" tabindex="-1"><a class="header-anchor" href="#_2-2-为什么选择国庆假期施工" aria-hidden="true">#</a> 2.2 为什么选择国庆假期施工？</h3><p>因为国庆假期时间比较长，同时 11 月份左右就要开始复习了。在国庆假期内施工完显然是比较完美的选择</p><h3 id="_2-3-社区施工的内容能与其他个人施工的质量相比吗" tabindex="-1"><a class="header-anchor" href="#_2-3-社区施工的内容能与其他个人施工的质量相比吗" aria-hidden="true">#</a> 2.3 社区施工的内容能与其他个人施工的质量相比吗？</h3><p>我相信社区的大佬们的能力和实力，相信不会弱于我个人施工的水平</p><h3 id="_2-4-为什么还要进行文档审查" tabindex="-1"><a class="header-anchor" href="#_2-4-为什么还要进行文档审查" aria-hidden="true">#</a> 2.4 为什么还要进行文档审查？</h3><p>因为文档的审查可以提高文档的质量，同时也可以让社区大佬们对文档进行优化。也可以避免有人恶意灌水或者涉政违法言论等</p><h3 id="_2-5-为什么想要参与省超算的计划" tabindex="-1"><a class="header-anchor" href="#_2-5-为什么想要参与省超算的计划" aria-hidden="true">#</a> 2.5 为什么想要参与省超算的计划？</h3><p>因为 省超算中心 能向我们提供免费的算力租借服务，减少服务器成本。如果无法通过申请会考虑采用我的私人服务器</p><p>那么为什么不直接用私人服务器呢？因为服务器有被打击的风险</p><p><img src="'+i+'" alt="攻击截图"></p><p><img src="'+c+'" alt="攻击截图1"></p><p>我的服务器如果向所有人公开极易遭受攻击，其造成的损失是我个人承担不起的（攻击造成损失 1743 元）。因此不到万不得已我不会公开我的服务器造成损失</p><p>但是省超算中心有相应的防御能力和应对措施，相比之下就会更加稳定和安全</p>',25),d=[h];function r(p,n){return s(),e("div",null,d)}const _=a(l,[["render",r],["__file","9.15.html.vue"]]);export{_ as default};
